// import React, { useState } from "react";
import styles from "./MainCard.module.css";
import Card from "./UI/Card";
import jeremyImage from "../assets/image-jeremy.png";

const MainCard = () => {
  // const [timeFrameIsActive, setTimeFrameIsActive] = useState(false);

  const clickHandler = (el) => {
    console.log(el.value);
    // el.props.addClass
  };
  const timeFrames = [{1: "Daily"}, {2:"Weekly"}, {3: "Monthly"}];

  return (
    <Card className={styles["main-card"]}>
      <header>
        <img src={jeremyImage} alt="Jeremy Robson" />
        <article>
          <p>Report for</p>
          <h1>Jeremy Robson</h1>
        </article>
      </header>
      <sub>
        {timeFrames.map((timeFrame) => (
          <p 
          onClick={clickHandler}
          // key={}
          >{timeFrame}</p>
        ))}
        {/* <p onClick={clickHandler}>Daily</p>
        <p className={styles.active}>Weekly</p>
        <p>Monthly</p> */}
      </sub>
    </Card>
  );
};

export default MainCard;
